{"id": "49235", 
"title": "Bug 49235: ServletContainerInitializer onStartup(Set<Class<? classSet is not expected class", 
"description": "Bug 49235: ServletContainerInitializer onStartup(Set<Class<? The output is 'MySomeClass'.", 
"OB": "When running the code, the output is 'MySomeClass'.", 
"EB": "The expected output is 'MySomeAnn'.", 
"SR": "To reproduce the issue, follow these steps:
1. Build Tomcat 7.0.0 from SVN r939221.
2. Use the following code:
   @MySomeAnn
   public class MySomeClass {
     ...
   }

   @HandlesTypes(MySomeAnn.class)
   public class ModuleInitializer implements ServletContainerInitializer {
     @Override
     public void onStartup(Set classSet, ServletContext ctx) throws ServletException {
       for (Class targetClass : classSet) {
         System.out.println(targetClass.getName());
       }
     }
   }
3. Run the program and observe the output, which should be 'MySomeAnn'."}
